import React from 'react';
import {IoChevronUpOutline, IoChevronDownOutline} from 'react-icons/io5';

function ListView() {

    const colors = ['#3e9cbf', '#a7ecf2', '#f2c43d', '#f17c37', '#f26d50'];
    const jodels = [
        {
            color: "#3e9cbf",
            channel: "@starwars",
            time: "32s",
            text: "Ootteko katton uuden Mandalorian -jakson?",
            hashtag: "#WheresBabyYoda",
            likes: 4
        },
        {
            color: "#a7ecf2",
            channel: "@Main",
            time: "1m",
            text: "Mitä tehdä Porissa perjantai iltana?",
            hashtag: "#Missämeno",
            likes: 4
        },
        {
            color: "#f2c43d",
            channel: "@hoas",
            time: "5m",
            text: "Miksei HOAS voi millään hoitaa noita pesukoineita kuntoon? Taas oli 3, 5:stä koneesta paskana...",
            hashtag: "",
            likes: 4
        },
        {
            color: "#f17c37",
            channel: "@Main",
            time: "1h",
            text: "Siis OMG kävin just ekaa kertaa salilla, ja siis se salin hottis työntekijä jäbä katteli mua.",
            hashtag: "#Salimake",
            likes: 4
        },
        {
            color: "#f26d50",
            channel: "@opiskelu",
            time: "3h",
            text: "Kuinka jaksatte opiskella kursseja jotka ei kiinnosta? Jeesiä kaivataan...",
            hashtag: "#studentlief",
            likes: 4
        },
    ]

    return(
        <div style={{display: 'flex', flexDirection: 'column'}}>
            {
            jodels.map((jodel) => (
            <div key={jodel.color} style={{backgroundColor: jodel.color}}>
                <div id='topBar' style={{margin: 10, display: 'flex'}}>
                    <p style={{color: "#fff", marginRight: 10}}><b>{jodel.channel}</b></p>
                    <p style={{color: "#fff"}}>{jodel.time}</p>
                </div>
                <div id='jodling' style={{display: 'flex', marginBottom: 40}}>
                    <div id='textContent' style={{margin: 10, flex: 8}}>
                        <p style={{color: "#fff"}}>{jodel.text}</p>
                        <p style={{color: "#fff"}}><b>{jodel.hashtag}</b></p>
                    </div>
                    <div id='controls' style={{margin: 10, flex: 1}}>
                        <IoChevronUpOutline style={{color: "#fff", fontSize: 20}}/>
                        <p style={{color: "#fff"}}>{jodel.likes}</p>
                        <IoChevronDownOutline style={{color: "#fff"}}/>

                    </div>
                </div>
            </div>
            ))
            }
        </div>
    )
}

export default ListView;
